from scalars import *


def flatten_one(xss):
    def _flatten_one(xss):
        for xs in xss:
            yield from xs
    return list(_flatten_one(xss))

def print_consts(dstsrc_pairs, label):
    for i, (dest, n) in enumerate(dstsrc_pairs):
        src = list(map(lambda x: f'{x}@bit', reversed([*f'{n:064b}'])))
        print(f'(* {label} #{i}: 0x{n:016x} *)')
        print('mov {} [{}];'.format(dest, ', '.join(src)))

